import { Link } from 'react-router-dom';
import './Main.css';
import ImageCard from './components/ImageCard';
import collage from './images/collage.jpeg';
function Main(){

    return (
        <div className='main'>
           <div className='items '>
                <Link style={{textDecoration: 'none'}} to='./Collage' > <ImageCard title='Collage' image={collage}  /> </Link>
                <Link to='./Carouseler' > <ImageCard title='Carouseler' image={collage} /> </Link>
                <Link to='./Scrolling' > <ImageCard title='Staged Scrolling' image={collage} /></Link>
           </div>
        </div>
    );
}
export default Main;
